	add("accession", "{\"term\":\"accession\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"* First attested in 1646.* From Latin \u0027accessio\u0027 from {{m|la|accēdō}} (English \u0027accede\u0027 . Cognate to French \u0027accession\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A coming to; the act of acceding and becoming joined; as, a king\u0027s \u0027\u0027accession\u0027\u0027 to a confederacy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Increase by something added; that which is added; augmentation from without\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"w:Edward Edward Gibbo\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The only \u0027\u0027accession\u0027\u0027 that the Roman empire received was the province of Britain\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A mode of acquiring property, by which the owner of a corporeal substance which receives an addition by growth, or by labor, has a right to the part or thing added, or the improvement (provided the thing is not changed into a different species\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The act by which one power becomes party to engagements already in force between other powers\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The act of coming to or reaching a throne, an office, or dignity\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The invasion, approach, or commencement of a disease; a fit or paroxysm\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Agreement\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Access; admittance\", \"priority\":10}]}, \"synonyms\":{}}");

	add("acciaccatura", "{\"term\":\"acciaccatura\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"{{borrowing|it|acciaccatura|lang\u003den}}, from the verb \u0027acciaccare\u0027 (to crush)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A short grace note (theoretically taking no time at all), occurring on the beat occupied by the main note to which it is prefixed, one scale-step higher or lower than that main note. (Sometimes equivalent, therefore, to a short \u0027appoggiatura\u0027, but in Baroque music interpreted differently and more strictly.) Written as a note lighter in appearance, typically a quaver (eighth note), with an oblique stroke through the stem\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accidence", "{\"term\":\"accidence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"* First attested in the late 14th century.* {{sense|grammar}} First attested in the mid 15th century. * From Latin \u0027accidentia\u0027 (lang\u003dla) from \u0027accidens\u0027 present participle of \u0027accidere\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027accidents\u0027\u0027, of inflections of words; the rudiments of grammar\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A book containing the first principles of grammar, and so of the rudiments of any subject or art\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The rudiments of any subject\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"James Russell Lowel\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Our best schools send every year to college boys who know their \u0027\u0027accidence\u0027\u0027 reasonably, and in some cases admirably well\", \"priority\":5}]}, \"synonyms\":{}}");

