	add("acclivity", "{\"term\":\"acclivity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"* First attested in 1614.* From Latin {{m|la|acclīvitās}}, from {{m|la|acclīvis||ascending}}, from \u0027ad\u0027 + {{m|la|clīvus||slope}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A slope or inclination of the earth, as the side of a hill, considered as \u0027ascending\u0027, in opposition to \u0027declivity\u0027, or \u0027descending\u0027; an upward slope; ascent\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Just below it leaned a tottering crag that would have toppled, starting an avalanche on an \u0027\u0027acclivity\u0027\u0027 where no sliding mass could stop\", \"priority\":2}]}, \"synonyms\":{}}");

	add("accolade", "{\"term\":\"accolade\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"English\", \"Italian\", \"Latin\", \"Occitan\"], \"text\":\"* First attested in the 1620s.* {{sense|award|praise}} First attested in 1852.* {{borrowing|fr|accolade|lang\u003den}}, from Occitan \u0027acolada\u0027 (an embrace) from Occitan \u0027acolar\u0027 (an embrace) from Italian \u0027accolata\u0027 from \u0027accolare\u0027 from Latin \u0027ad-\u0027 + \u0027collum\u0027 (neck) (English \u0027collar\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Image from page 061 of The Century dictionary and cyclopedia (1897) thumb|upright|\u0027\u0027Accolade\u0027\u0027, early 16th century (France\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An expression of approval; praise\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A special acknowledgment; an award\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An embrace of greeting or salutation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A salutation marking the conferring of knighthood, consisting of an embrace or a kiss, and a slight blow on the shoulders with the flat of a sword\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A brace used to join two or more staves\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Written Presidential certificate recognizing service by personnel who died or were wounded in action between 1917 and 1918, or who died in service between 1941 and 1947, or died of wounds received in Korea between June 27, 1950 and July 27, 1954. Service of civilians who died overseas or as a result of injury or disease contracted while serving in a civilian capacity with the United States Armed Forces during the dates and/or in areas prescribed is in like manner recognized\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An ornament composed of two ogee curves meeting in the middle, each concave toward its outer extremity and convex toward the point at which it meets the other. Such accolades are either plain or adorned with rich moldings, and are a frequent motive of decoration on the lintels of doors and windows of the fifteenth and sixteenth centuries, especially in secular architecture\", \"priority\":8}]}, \"synonyms\":{}}");

	add("accommodableness", "{\"term\":\"accommodableness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"accommodable + -ness\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or condition of being accommodable\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accommodation", "{\"term\":\"accommodation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027accommodation\u0027 from Latin {{m|la|accommodātiō||adjustment, accommodation, compliance}}, from {{m|la|accommodō||adapt, put in order}}. Superficially {{suffix|accommodate|tion|lang\u003den}}. The sense of \u0026quot;lodging\u0026quot; was first attested in 1600.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Lodging in a dwelling or similar living quarters afforded to travellers in hotels or on cruise ships, or prisoners, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Adaptation or adjustment\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of fitting or adapting, or the state of being fitted or adapted; adaptation; adjustment\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Sir (1609-1676\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The organization of the body with \u0027\u0027accommodation\u0027\u0027 to its functions\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A convenience, a fitting, something satisfying a need\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d10|passage\u003dMr. Cooke had had a sloop yacht built at Far Harbor, the completion of which had been delayed, and which was but just delivered. […] The Maria had a cabin, which was finished in hard wood and yellow plush, and \u0027\u0027accommodations\u0027\u0027 for keeping things cold\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The adaptation or adjustment of an organism, organ, or part\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The adjustment of the eye to a change of the distance from an observed object\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Adaptation or adjustment\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Willingness to accommodate; obligingness\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Adjustment of differences; state of agreement; reconciliation; settlement; compromise\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1800-1859\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"To come to terms of \u0027\u0027accommodation\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The application of a writer\u0027s language, on the ground of analogy, to something not originally referred to or intended\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1743-1805\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Many of those quotations from the Old Testament were probably intended as nothing more than \u0027\u0027accommodations\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A loan of money\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"An accommodation bill or note\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"An offer of substitute goods to fulfill a contract, which will bind the purchaser if accepted\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"The place where sediments can make, or have made, a sedimentation\", \"priority\":21}]}, \"synonyms\":{}}");

	add("accommodationism", "{\"term\":\"accommodationism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|accommodation|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A policy of being accommodating\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accommodator", "{\"term\":\"accommodator\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|accommodate|or|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who accommodates\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accompanier", "{\"term\":\"accompanier\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|accompany|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone or something that accompanies\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accompaniment", "{\"term\":\"accompaniment\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* First attested in 1744.* {{suffix|accompany|ment|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A part, usually performed by instruments, that gives support or adds to the background in music, or adds for ornamentation; also, the harmony of a figured bass\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which accompanies; something that attends as a circumstance, or which is added to give greater completeness to the principal thing, or by way of ornament, or for the sake of symmetry\", \"priority\":2}]}, \"synonyms\":{}}");

	add("accompanist", "{\"term\":\"accompanist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* First attested in 1833.{{suffix|accompany|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The performer in music who takes the accompanying part\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accomplice", "{\"term\":\"accomplice\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"First attested in the 1580s. From Middle english (1100-1500) \u0027a\u0027 + \u0027complice\u0027 from Old french (842-ca. 1400) \u0027complice\u0027 (confederate) from Latin \u0027complicare\u0027 (fold together)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cooperator\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Success unto our valiant general, And happiness to his \u0027\u0027accomplices\u0027\u0027! - Shakespeare, \u0027Henry VI Part I, V-ii\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An associate in the commission of a crime; a participator in an offense, whether a principal or an accessory\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"And thou, the cursed \u0027\u0027accomplice\u0027\u0027 of his treason. - Johnso\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Suspected for \u0027\u0027accomplice\u0027\u0027 to the fire. - w:John John Dryden\", \"priority\":5}]}, \"synonyms\":{}}");

	add("accomplicity", "{\"term\":\"accomplicity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|accomplice|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or state of being an accomplice\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accomplisher", "{\"term\":\"accomplisher\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|accomplish|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who accomplishes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accomplishment", "{\"term\":\"accomplishment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"* First attested in the early 15th century.* {{sense|completes|perfects|equips}} First attested around 1600.* {{suffix|accomplish|ment|lang\u003den}}* From Old french (842-ca. 1400) \u0027accomplissement\u0027 from \u0027accomplir\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of accomplishing; entire performance; completion; fulfillment; as, the \u0027\u0027accomplishment\u0027\u0027 of an enterprise, of a prophecy, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which completes, perfects, or equips thoroughly; acquirement; attainment; that which constitutes excellence of mind, or elegance of manners, acquired by education or training\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"My new \u0027\u0027accomplishment\u0027\u0027 of dancing. - w:Charles Churchill Charles Churchil\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Accomplishments\u0027\u0027 befitting a station. - w:William Makepeace William Makepeace Thackera\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Accomplishments\u0027\u0027 have taken virtue\u0027s place, / And wisdom falls before exterior grace. - w:William William Cowpe\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Something accomplished; an achievement\", \"priority\":6}]}, \"synonyms\":{}}");

	add("accordance", "{\"term\":\"accordance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"* {{sense|compliance}} First attested around 1300.* {{sense|agreement}} First attested in the early 14th century.* {{suffix|accord|ance|lang\u003den}}* From Old french (842-ca. 1400) \u0027acordance\u0027 (agreeing, reconciliation, harmony)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Agreement; harmony; conformity; compliance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In strict \u0027\u0027accordance\u0027\u0027 with the law - w:Thomas Babington Thomas Babington Macaula\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of granting\", \"priority\":3}]}, \"synonyms\":{}}");

	add("accordion", "{\"term\":\"accordion\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"French\", \"old french (842-ca. 1400)\", \"Italian\"], \"text\":\"First attested in 1831. From German \u0027lang\u003dde\u0027 from \u0027akkord\u0027 (harmony) from French \u0027accord\u0027 from Old french (842-ca. 1400) \u0027acorder\u0027 based on Italian \u0027lang\u003dit|accordare\u0027 () See also accord.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small, portable, keyed wind instrument, whose tones are generated by play of the wind from a squeezed bellows upon free metallic reeds\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1869\u0027\u0027, w:Mark Mark Twain, \u0027Innocents Abroad\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A disreputable \u0027\u0027accordion\u0027\u0027 that had a leak somewhere and breathed louder than it squawked\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"w:Ambrose Ambrose Bierce, \u0027Devil’s Dictionary\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Accordion\u0027\u0027: an instrument in harmony with the sentiments of an assassin\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027, w:James James Joyce, \u0027Ulysses\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An \u0027\u0027accordion\u0027\u0027 underskirt of blue silk moirette\", \"priority\":7}]}, \"synonyms\":{}}");

	add("accordionist", "{\"term\":\"accordionist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|accordion|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who plays the accordion\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accostment", "{\"term\":\"accostment\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|accost|ment|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an action of accosting\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accoucheur", "{\"term\":\"accoucheur\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"* First attested in 1759.* {{borrowing|fr|accoucheur|lang\u003den}}, from {{m|fr|accoucher||to go to childbed, be delivered}}, from Old french (842-ca. 1400) {{m|fro|culcher||to lie}}, from Latin {{m|la|collocō||I place, put, set in order, assign}}, from {{m|la|cum|com|with}} + {{m|la|locō||I put, place, set}}. See {{m|en|accouchement}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man who assists women in childbirth; a male midwife; an obstetrician\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Hilary Mantel, \u0027A Place of Greater Safety\u0027, Harper Perennial 2007, p. 163\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Family story: on the day of his birth the \u0027\u0027accoucheur\u0027\u0027 approached his father, the baby wrapped in a cloth\", \"priority\":3}]}, \"synonyms\":{}}");

	add("accountability", "{\"term\":\"accountability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|accountable|ity|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being accountable; liability to be called on to render an account; accountableness; responsible for; answerable for\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The obligation imposed by law or lawful order or regulation on an officer or other person for keeping accurate record of property, documents, or funds. The person having this obligation may or may not have actual possession of the property, documents, or funds. Accountability is concerned primarily with records, while responsibility is concerned primarily with custody, care, and safekeeping. (JP 1-02 Department of Defense Dictionary of Military and Associated Terms\", \"priority\":2}]}, \"synonyms\":{}}");

	add("accountableness", "{\"term\":\"accountableness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|accountable|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or state of being accountable; accountability\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accountancy", "{\"term\":\"accountancy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|account|ancy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The function of compiling and providing financial information primarily by reports referred to as financial statements. Accounting includes bookkeeping, systems design, analysis and interpretation of accounting information\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A company or organisation that performs such a function\", \"priority\":2}]}, \"synonyms\":{}}");

	add("accounter", "{\"term\":\"accounter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|account|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person providing an account of events\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person providing an accounting of expenditure or other actions\", \"priority\":2}]}, \"synonyms\":{}}");

	add("accouplement", "{\"term\":\"accouplement\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027accouplemen. French|accouplement\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of coupling, or the state of being coupled; unio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which couples, as a tie or brace\", \"priority\":2}]}, \"synonyms\":{}}");

	add("accouterment", "{\"term\":\"accouterment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"* First attested in the 1540s.* From Middle french (ca. 1400-1600) \u0027accoustrement\u0027 from \u0027accoustrer\u0027 from Old french (842-ca. 1400) \u0027acostrer\u0027 (arrange, sew up)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of accoutering\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An article of clothing or equipment, in particular when used as an accessory\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"apparatus needed for a task or journey\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Equipment other than weapons and uniform\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"trappings\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An identifying yet superficial characteristic\", \"priority\":6}]}, \"synonyms\":{}}");

	add("accouterments", "{\"term\":\"accouterments\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"quot;How gay with all the \u0027\u0027accouterments\u0027\u0027 of war!\u0026quot; \u0026amp;ndash; A. Philips\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accoutrement", "{\"term\":\"accoutrement\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027accoustrement\u0027 from \u0027accoustrer\u0027 + \u0027-ment\u0027 from Old french (842-ca. 1400) \u0027acostrer\u0027 (arrange, sew up)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of accoutering\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An article of clothing or equipment, in particular when used as an accessory\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"apparatus needed for a task or journey\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Equipment other than weapons and uniform\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"trappings\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An identifying yet superficial characteristic\", \"priority\":6}]}, \"synonyms\":{}}");

	add("accrescence", "{\"term\":\"accrescence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"From Italian from \u0027accrescentia\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Continuous growth; an accretion\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accrual", "{\"term\":\"accrual\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|accrue|al|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An increase; something that accumulates, especially an amount of money that periodically accumulates for a specific purpos\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a charge incurred in one accounting period that has not been paid by the end of it\", \"priority\":2}]}, \"synonyms\":{}}");

	add("accubation", "{\"term\":\"accubation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin \u0027accubatio\u0027 \u0027accubitio\u0027 from {{m|la|accubāre||to recline}}, from \u0027\u0027 (ad-) + {{m|la|cubāre||to lie down}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Image from page 065 of The Century dictionary and cyclopedia (1897) thumb|\u0027\u0027Accubation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act or posture of reclining on a couch, as practiced by the ancients at meals\", \"priority\":2}]}, \"synonyms\":{}}");

	add("acculturation", "{\"term\":\"acculturation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* First attested in 1880.* ad- (\u0026quot;toward\u0026quot;) + {{suffix|culture|ation|t2\u003da process|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A process by which the culture of an isolated society changes on contact with a different one\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A process by which a person acquires the culture of the society that he/she inhabits, starting at birth\", \"priority\":2}]}, \"synonyms\":{}}");

	add("accumulatio", "{\"term\":\"accumulatio\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|accumulātiō||the act of heaping up}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A forceful summarisation of previously made points\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accumulation", "{\"term\":\"accumulation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* First attested in the late 15th century.* {{suffix|accumulate|tion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of amassing or gathering, as into a pile\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The process of growing into a heap or a large amount\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"an \u0027\u0027accumulation\u0027\u0027 of earth, of sand, of evils, of wealth, or of honors\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A mass of something piled up or collected\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The concurrence of several titles to the same proof\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The continuous growth of capital by retention of interest or savings\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The action of investors buying an asset from other investors when the price of the asset is low\", \"priority\":7}]}, \"synonyms\":{}}");

	add("accumulativeness", "{\"term\":\"accumulativeness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|accumulative|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or qualities of being accumulative\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accumulator", "{\"term\":\"accumulator\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"* {{suffix|accumulate|or|lang\u003den}}. * From Latin {{m|la|accumulātor}}, agent noun of {{m|la|accumulō||pile up}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, accumulates\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He is a great \u0027\u0027accumulator\u0027\u0027 of bad jokes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A wet wet-cell storage battery\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Looks like it\u0027s time to recharge the \u0027\u0027accumulator\u0027\u0027 again\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A collective bet on successive events, with both stake and winnings being carried forward to accumulate progressively\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A system of elastic springs for relieving the strain upon a rope, as in deep-sea dredging\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A vessel containing pressurized hot water ready for release as steam\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A container which stores hydraulic power for release, in the form of a pressurized fluid (often suspended within a larger tank of fluid under pressure\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A register in a calculator or computer used for holding the intermediate results of a computation or data transfer\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A derivative contract under which the seller commits to sell shares of an underlying security at a certain strike price, which the buyer is obligated to buy\", \"priority\":10}]}, \"synonyms\":{}}");

	add("accurateness", "{\"term\":\"accurateness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|accurate|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being accurate; accuracy; exactness; nicety; precision\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accusal", "{\"term\":\"accusal\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|accuse|al|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"accusation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accusant", "{\"term\":\"accusant\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027accusans\u0027 present participle of \u0027accusare\u0027 Compare French \u0027accusant\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An accuser\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accusation", "{\"term\":\"accusation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"First attested in the late 14th century. From Old french (842-ca. 1400) \u0027acusacion\u0027 (French \u0027accusation\u0027 , from Latin {{m|la|accūsātiō||accusation, indictment}}, from {{m|la|accūsō||blame, accuse}}. More at \u0027accuse\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of accusing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A formal charge brought against a person in a court of law\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They] set up over his head his \u0027\u0027accusation\u0027\u0027 - \u0027Matthew 27:37\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An allegation\", \"priority\":4}]}, \"synonyms\":{}}");

	add("accusativeness", "{\"term\":\"accusativeness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The characteristics of the accusative case of a noun or pronoun\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The condition of tending to accuse\", \"priority\":2}]}, \"synonyms\":{}}");

